import React, {useState, useEffect} from 'react';
import { useDispatch, useSelector } from 'react-redux';
import SelectedDate from '../../components/date/SelectedDate';
import Heading from '../inputUI'

export default function DigerList() {

    const [inter, setInter] = useState(new Date());

    return (
        <section className="mt-3">
            <h2 className="display-5 text-gray"> Diğer Bilgiler </h2>
            <div className="row">
                <div className="col-6">
                    <SelectedDate
                    id="digerliste"
                    onChangeHandler={(date) => setInter(date)} 
                    date={inter}/>
                </div>     
            </div>
            <div className="row mt-3">
                <div className="col-12">
                Diğer Bilgiler
                </div>
            </div>
        </section>
    )
}
